%[text] $E\\left(I,V\\right)=I^2 +V^2 -\\mathrm{I}\\mathrm{V}+I-V+3${"editStyle":"visual"}
%[text] With constraint
%[text] $2V-I\\le -1${"editStyle":"visual"}
%[text] I am assuming
%[text] $\\begin{array}{l}\nI=x\\\\\nV=y\n\\end{array}${"editStyle":"visual"}
E = @(x, y) x.^2 + y.^2 - x.*y + x - y + 3;

xs = linspace(-2, 2, 100);
[X,Y] = meshgrid(xs);
Z = E(X, Y);
contour(X, Y, Z); %[output:4f8e1f7c]
xlabel("I"); %[output:4f8e1f7c]
ylabel("V"); %[output:4f8e1f7c]
hold on; %[output:4f8e1f7c]

% turning the constraint into y<=(x - 1)/2
G = @(x) (x - 1) / 2;
plot(xs, G(xs), "y-"); %[output:4f8e1f7c]
% Below this line is the search space

% From solving the Lagrange function the constrained minimum is
plot(-1/3, -2/3, "ro", MarkerFaceColor="r") %[output:4f8e1f7c]

